import { useTasks } from './Context'

export const Display = () => {
    const { todo }  = useTasks()
    return(
        <>
            <ul>
            {
                todo.map((task,index) => {
                    return(
                        <li>
                            {index , task.description}
                        </li>
                    )
                })
            }
            </ul>
        </>
    )
}
